import React from "react";
import AfterNavbar from "../Navbar/AfterNavbar";

const MainPage = () => {
  return (
    <div>
      <AfterNavbar />
      <div className="motiv-title">
        <h1>Find your partner</h1>
        <h1>Talk with them</h1>
        <h1>Become friends</h1>
      </div>
    </div>
  );
};

export default MainPage;
